import React from "react";

import "./SkillItem.css";

const SkillItem = props => {
  return (
    <div className="skillItem__wrapper">
      <p className="skillItem__skill"> {props.skill} </p>
      <p className="skillItem__level"> {"⭐".repeat(props.level)} </p>
    </div>
  );
};

export default SkillItem;

// ⭐⚝
